This is the value of impairment charged to profit and loss in respect of tangible assets other than:

- property, plant and equipment;
-  investments in controlled entities,  associates and joint ventures; and
-  impairment losses on financial assets not measured at fair value through profit or loss;

as determined in accordance with accounting standards.

This is the value of other expenses recognised in the profit or loss during the relevant period, that are considered to be operating (or recurring), as required to be reported on APRA form GRF_310_0_G.

This item consists of operating expenses that do not relate to:
- expenses included in the underwriting result;
- investment expenses on assets backing insurance liabilities;
- investment expenses on shareholders' funds;
- net foreign exchange losses; and
- defined benefit actuarial losses.

This is the balancing item in the list in which it is being used.

This is the value of other operating expenses as defined by APRA form ARF_330_3 Item 4.9. This comprises:

- Operating expenses from continuing operations as determined in accordance with accounting standards other than interest expense and charge for bad and doubtful debts;
- negative goodwill immediately recognised in profit and loss;
- share of net profits/losses of associates and joint ventures accounted for using the equity method; and
- profit or loss from non-current assets and disposal groups classified as held for sale not qualifying as discontinued operations;

other than:

- personnel expenses;
- occupancy and equipment expenses;
- IT services expenses;
- depreciation, amortisation and impairment expenses;
- impairment losses and reversals on financial assets;
- non-lending losses and fraud expenses;
- fees and commission expenses;
- audit fees; and
- directors' fees.

This is the balancing item in the list in which it is being used.

This is the value of other operating expenses as defined by APRA form ARF_330_3 Item 5. This comprises:

- Operating expenses from continuing operations as determined in accordance with accounting standards other than interest expense and charge for bad and doubtful debts;
- negative goodwill immediately recognised in profit and loss;
- share of net profits/losses of associates and joint ventures accounted for using the equity method; and
- profit or loss from non-current assets and disposal groups classified as held for sale not qualifying as discontinued operations.
